import React, { Component } from 'react';

class Input extends Component {
  state = {
    term: '',
  };
  handleClick = (e) => {
    e.preventDefault();
    console.log(e);
  };
  render() {
    return (
      <div class="ui input" onSubmit={this.handleClick}>
        <input
          type="text"
          placeholder="Search..."
          value={this.state.term}
          onChange={(e) => this.setState({ term: e.target.value })}
        />
      </div>
    );
  }
}

export default Input;
